		var monster_width = 188; // The width of the group 'monster'
var monster_height = 224; // The height of the group 'monster'

function update_cursor(event_information) {

    /*
        event_information.pageX is the current X position of the mouse
        event_information.pageY is the current Y position of the mouse

        To make the 'monster' follow the mouse, we use this:
        "translate(" + event_information.pageX + " " + event_information.pageY + ")"
        And the top left corner of the monster will follow the mouseup

        To make the center of the monster follow the mouse, we need to adjust the amount
        of translate by subtracting half the width of the monster from the X position and
        subtracting half the height of the monster from the Y position
    */

    // The following two lines make the center of the monster follow the mouse
    var new_x = event_information.pageX - monster_width / 2;
    var new_y = event_information.pageY - monster_height / 2;
    var new_position_text = "translate(" + new_x + " " + new_y + ")";

    // Move the monster to the correct position
    var monster = document.getElementById("monster");
    monster.setAttribute("transform", new_position_text);

    // Show the mouse X position in the web page
    var x_position = document.getElementById("x_position");
    x_position.textContent = event_information.pageX;

    // Show the mouse Y position in the web page
    var y_position = document.getElementById("y_position");
    y_position.textContent = event_information.pageY;
}
		
		
		
		
		
			
