			function playGunshot() {
				gunshotText = "gunshotSFX" + (gunshotNum % 30);
				document.getElementById(gunshotText).play();
				gunshotNum++;
			}
			function startGame() {
				player = {
					x: 500,
					y: 400,
					r: 50,
					svgEquiv: document.getElementById("player"),
					move: function(dir) {
						switch (dir) {
							case "left":
							player.x -= 15;
							break;
							case "right":
							player.x += 15;
							break;
							case "up":
							player.y -= 15;
							break;
							case "down":
							player.y += 15;
							break;
							default:
							alert("ERROR!  THIS DIRECTION DOES NOT EXIST!  CHECK YOUR CODE!");
						}
						player.svgEquiv.setAttribute("transform", "translate("+player.x+" "+player.y+")");
					},
					init: function() {
						player.svgEquiv.setAttribute("transform", "translate("+player.x+" "+player.y+")");
						player.svgEquiv.setAttribute("visibility", "visible");
					},
					preventEscape: function() {
						if (player.x < 0) {
							player.x = 0;
						} else if (player.y < 0) {
							player.y = 0;
						} else if (player.x > 1000) {
							player.x = 1000;
						} else if (player.y > 800) {
							player.y = 800;
						} else {
							void(0);
						}
						player.svgEquiv.setAttribute("transform", "translate("+player.x+" "+player.y+")");
					}
				};
