				document.onkeydown = function(event) {
					/*
						Key Codes
						---------
						W = 87
						A = 65
						S = 83
						D = 68
					*/
					switch (event.keyCode) {
						case 87:
						player.move("up");
						break;
						case 65:
						player.move("left");
						break;
						case 83:
						player.move("down");
						break;
						case 68:
						player.move("right");
						break;
					}
					player.preventEscape();
				}
